import React, { Component } from './node_modules/react';
import axios from '../../../node_modules/axios';
import { Link } from './node_modules/react-router-dom';



export default class Collection extends Component {

  constructor(props) {
    super(props);

    this.state = {
      places: [],
    };
  }

  componentDidMount() {

    const collectionQuery = {
      collectionName: this.props.collectionName
    }

    axios.post('http://localhost:5000/collections/collectionName/', collectionQuery)
      .then(response => {
        this.setState({ 
          places: response.data
        })
      })
      .catch((error) => {
        console.log(error);
      })
    }

    render() {
      return (
        <tr>
          <td>{this.state.collectionName}</td>
          <td>{props.placeName}</td>
          <td>{props.address}</td>
          <td>{props.type}</td>
          <td>{props.comments}</td>
          <td>
            <Link to={"/edit/"+props.places}>edit</Link> | <a href="#" onClick={e => { props.deletePlaceFromCollection(props.places.name) }}>delete</a>
          </td>
        </tr>
      )
    }

}
